INSERT INTO `message` VALUES ('1092', '353', 'http://115.29.34.67/jyupload/message/201408161718291829-b71d31a5-72e6-4767-8d9b-7b6c17f290e5-Demo_1.png', '480', '640', '573', '嘿哥们儿，上张靓照啦，整个大黑屏怎么吸引美眉的兴趣呀，是吧', '0', '0', '0', null, null, '2014-08-16 17:18:29', null);
