INSERT INTO `message` VALUES ('1094', '562', 'http://115.29.34.67/jyupload/message/201408161720322032-3512dc28-7f4f-4d99-8030-b083fd1d96da-Demo_1.png', '960', '1280', '353', '这个真不是问题。一个城市只要做几个场子，她们会帮你象蒲公英一样传播出去。花些小钱而已。增加群聊功能，就把管理带起来了。这很重要', '1', '0', '1', null, null, '2014-08-16 17:20:32', null);
INSERT INTO `message` VALUES ('1095', '353', 'http://115.29.34.67/jyupload/message/201408161721232123-b71d31a5-72e6-4767-8d9b-7b6c17f290e5-Demo_1.png', '480', '640', '570', '嘿哥们儿，上张靓照啦，不露脸怎么吸引美眉的兴趣呀，是吧', '0', '0', '0', null, null, '2014-08-16 17:21:23', null);
