INSERT INTO `message` VALUES ('1098', '353', 'http://115.29.34.67/jyupload/message/20140816172402242-b71d31a5-72e6-4767-8d9b-7b6c17f290e5-Demo_1.png', '480', '640', '562', '你回复就消失了，呵呵', '1', '0', '1', null, null, '2014-08-16 17:24:02', null);
INSERT INTO `message` VALUES ('1099', '562', 'http://115.29.34.67/jyupload/message/201408161725332533-3512dc28-7f4f-4d99-8030-b083fd1d96da-Demo_1.png', '960', '1280', '353', '应该会不回复阅后都消失才对', '1', '0', '1', null, null, '2014-08-16 17:25:33', null);
INSERT INTO `message` VALUES ('1100', '353', 'http://115.29.34.67/jyupload/message/201408161726422642-b71d31a5-72e6-4767-8d9b-7b6c17f290e5-Demo_1.png', '480', '640', '562', '那你怎么回复？对吧', '1', '0', '1', null, null, '2014-08-16 17:26:42', null);
INSERT INTO `message` VALUES ('1101', '562', 'http://115.29.34.67/jyupload/message/201408161728252825-3512dc28-7f4f-4d99-8030-b083fd1d96da-Demo_1.png', '960', '1280', '353', '1你要先把操作做好。2，要有后续2步的思路', '1', '0', '1', null, null, '2014-08-16 17:28:25', null);
INSERT INTO `message` VALUES ('1102', '353', 'http://115.29.34.67/jyupload/message/20140816173202322-b71d31a5-72e6-4767-8d9b-7b6c17f290e5-Demo_1.png', '480', '640', '562', '说的极是', '1', '1', '0', null, null, '2014-08-16 17:32:02', null);
INSERT INTO `message` VALUES ('1103', '562', 'http://115.29.34.67/jyupload/message/201408161732273227-3512dc28-7f4f-4d99-8030-b083fd1d96da-Demo_1.png', '960', '1280', '353', '不对，想回复一定会回，忘记了还可以再发。阅后即焚是最大的卖点，可以让人没有顾忌，这样就没节操了，没节操了人就有娱乐性了。不要高大上，是追求没底线好吗。', '1', '0', '1', null, null, '2014-08-16 17:32:27', null);
INSERT INTO `message` VALUES ('1104', '353', 'http://115.29.34.67/jyupload/message/201408161734433443-b71d31a5-72e6-4767-8d9b-7b6c17f290e5-Demo_1.png', '480', '640', '562', '之前是这样的，用户反馈要求回复后再焚，我在1.4版改过来的', '1', '0', '1', null, null, '2014-08-16 17:34:43', null);
INSERT INTO `message` VALUES ('1105', '562', 'http://115.29.34.67/jyupload/message/20140816173806386-3512dc28-7f4f-4d99-8030-b083fd1d96da-Demo_1.png', '960', '1280', '353', '这还不简单。给2个模式，一个阅后即焚，一个回复后消失，用户可自选，虽然增加了一个切换按钮，但可以明确用户的类别和趋势。', '1', '0', '1', null, null, '2014-08-16 17:38:06', null);
INSERT INTO `message` VALUES ('1106', '353', 'http://115.29.34.67/jyupload/message/201408161740204020-b71d31a5-72e6-4767-8d9b-7b6c17f290e5-Demo_1.png', '480', '640', '562', '变复杂了，不过是个可行的方案', '1', '0', '1', null, null, '2014-08-16 17:40:20', null);
INSERT INTO `message` VALUES ('1107', '562', 'http://115.29.34.67/jyupload/message/201408161741564156-3512dc28-7f4f-4d99-8030-b083fd1d96da-Demo_1.png', '960', '1280', '353', '而且如果你要回复后才焚，变成你发8条，我要回复8条', '1', '0', '1', null, null, '2014-08-16 17:41:56', null);
INSERT INTO `message` VALUES ('1108', '353', 'http://115.29.34.67/jyupload/message/20140816180528528-b71d31a5-72e6-4767-8d9b-7b6c17f290e5-Demo_1.png', '480', '640', '562', '可以点“x\"键删除', '1', '0', '1', null, null, '2014-08-16 18:05:28', null);
INSERT INTO `message` VALUES ('1109', '562', 'http://115.29.34.67/jyupload/message/201408161811381138-3512dc28-7f4f-4d99-8030-b083fd1d96da-Demo_1.png', '960', '1280', '353', '要有区域选择，否则十万八千里的，解决不了部分人的问题。', '0', '0', '0', null, null, '2014-08-16 18:11:38', null);
INSERT INTO `message` VALUES ('1110', '562', 'http://115.29.34.67/jyupload/message/20140816181602162-3512dc28-7f4f-4d99-8030-b083fd1d96da-Demo_1.png', '960', '1280', '353', '要有区别，要无限放大这个特色。否则和短信有啥区别。要考虑这东西是给谁用？反正我认为不是给那些等回复的人用的。看到了，给时间了，给机会了。又不是留着怀念用的。', '1', '0', '1', null, null, '2014-08-16 18:16:02', null);
